import React from "react";
import { DivFeed, Posts, DivCreatePost, DivListPost, DivHeader} from "./Styled-Feed";
import Header from "../../components/header/Header";
import {logog1} from "../../constants/assets/UnionlogoG1.svg" 

const FeedPage = () => {

    const noticiesPosts = [
        {
            "posts": [
                {
                    "id": 1,
                    "titulo": "Título do Post 1",
                    "materia": "Conteúdo da matéria do Post 1...",
                    "imagem": "https://example.com/image1.jpg",
                    "data": "2023-01-15"
                },
                {
                    "id": 2,
                    "titulo": "Título do Post 2",
                    "materia": "Conteúdo da matéria do Post 2...",
                    "imagem": "https://example.com/image2.jpg",
                    "data": "2023-01-16"
                },
                {
                    "id": 3,
                    "titulo": "Título do Post 3",
                    "materia": "Conteúdo da matéria do Post 3...",
                    "imagem": "https://example.com/image3.jpg",
                    "data": "2023-01-17"
                }
            ]
        }

    ];

    const printNoticias = (noticias) => {
        return (
          <ul>
            {noticias.map((noticia) => (
              <li key={noticia.id}>
                <h2>{noticia.titulo}</h2>
                <p>{noticia.materia}</p>
                <img src={noticia.imagem} alt={noticia.titulo} />
                <p>{noticia.data}</p>
              </li>
            ))}
          </ul>
        );
      };
    console.log(printNoticias(noticiesPosts[0].posts));

    return(
        <DivFeed>
            <DivHeader>
            <Header />
            </DivHeader>
            <DivListPost>
                <Posts>
                    <div> 
                    {printNoticias(noticiesPosts[0].posts)}

                    </div>
                </Posts>
            </DivListPost>
        </DivFeed>
    )

}

export default FeedPage;
